<p>55565 (2002 AW₁₉₇) is a classical Kuiper belt object (cubewano) and a possible dwarf planet about 768 km in diameter. It is tied with <a href="celaddon://item?item=848D30D2-A379-F6C3-5A7D-1B2DA4C9CF52">2002 MS₄</a> and <a href="celaddon://item?item=CC484A6E-1F2A-426A-B9C5-5889A19B520F">2013 FY₂₇</a> as the largest unnamed objects in the Solar System</p>
